import React, { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css';
function About()
{
    useEffect(()=>{
        AOS.init({
            duration:3000
        })

    },[])
    return(
        <div>Abouts

<div data-aos="zoom-out" data-aos-offset="200" data-aos-easing="ease-in-sine" data-aos-duration="600">
<img src='./images/r.webp'/> 
</div>

        </div>
    )
}
export default About;
